/// <summary>
/// Constants used for outbound work load chart.
/// </summary>
internal final class WHSOutboundWorkLoadChartConstants
{
    /// <summary>
    /// Format for the data labels on the chart for open lines.
    /// </summary>
    internal const str OpenLinesDataLabelsFormat = '{y} lines';

    /// <summary>
    /// Format for the data labels on the chart for open headers.
    /// </summary>
    internal const str OpenHeadersDataLabelsFormat = '{y} headers';

    /// <summary>
    /// Used in the conversion of work execution time from seconds to minute.
    /// </summary>
    internal const int OneMinute = 60;
}
